import React, { useState } from 'react';


const ex = () => {
    const [workouts, setWorkouts] = useState([
        { id : 1,
        type: "Push",
        date : "7/26/2024",
            num : 2,}
    ]);
    return ( <div className="ex">
        <h3>Past Workouts</h3>
        {workouts.map((workout) =>(
            <div key={workout.id}>

            </div>
        ))}

        </div> );
}
 
export default ex;
